        public async Task<Item> GetByIdAsync(int id)
        {
            const string sql = @"SELECT
                                ItemId, Name, Description, Category, Image AS ImageData,
                                UserId
                            FROM dbo.Item
                            WHERE ItemId = @Id;";

            var item = await _dbConnection.QuerySingleAsync<Item>(sql, new { Id = id });

